import React from "react";

const Currinfo = () => {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Pot Information</h5>
        <p className="card-text">The number you choose : 32</p>
        <a href="#" className="btn btn-primary">Get Your Number</a>
      </div>
    </div>
  );
}

export default Currinfo
